  Double* SQ_ERI_G_S_G_S_vrr_array = scr.getNewMemPos(225);
  Double* SQ_ERI_G_S_F_S_vrr_array = scr.getNewMemPos(150);
  Double* SQ_ERI_D_S_G_S_vrr_array = scr.getNewMemPos(90);
